import React from "react";
import ReactDom from "react-dom";
import { Route } from "react-router-dom";
import App from "./components/App";

ReactDom.render(
  <Route>
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>
    </Switch>
  </Route>,
  document.querySelector("#root")
);
